import styled from "styled-components";

export const ContactWrapper = styled.div`
  margin-top: 5rem;
`;

export const Image = styled.img`
  max-width: 120px;
  margin: 0 auto;
  margin-bottom: 1rem;
`;

export const SchoolImg = styled.img`
  float: left;
  max-width: 120px;
  margin: 0 auto;
  margin-right: 1rem;
  margin-bottom: 1rem;
`;

export const Technologies = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  margin-right: auto;
  margin-left: auto;
  margin-bottom: -2rem;
`;

export const Tech = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  max-width: 150px;
  min-width: 100px;
  margin-bottom: 2rem;
`;

export const TechImg1 = styled.img`
  height: 40px;
  width: auto;
`;
export const TechImg2 = styled.img`
  height: 44px;
  width: auto;
  margin: 0.6rem;
`;

export const TechName = styled.div`
  font-size: 14px;
`;
